import '../style/card.css'
import book from '../book.json'

export default function Card() {
    cosefetch({
        method: 'GET',
        url: 'http://books.cloudfoundry.com/books',
        headers: {
            'Accept': 'text/html'
        }
    })
    console.log(json);
  return (
    <div>
        <div className="book">
            
            <img src="https://via.placeholder.com/150" alt="book" />
            <h3>Book Title</h3>
            <p>Author Name</p>
            <span>$9.99</span>
        </div>
    </div>
  );
}
